CREATE TABLE ods3 (
                      id varchar(5) NOT NULL,
                      global  varchar(500) DEFAULT NULL,
                      brasil  varchar(500) DEFAULT NULL,
                      PRIMARY KEY ( id )
);

CREATE TABLE indicadores (
                             id  varchar(5) NOT NULL,
                             descricao  varchar(200) NOT NULL,
                             ods3_id  varchar(5) DEFAULT NULL,
                             PRIMARY KEY ( id )
);

CREATE TABLE regiao (
                        id_regiao  varchar(5) NOT NULL,
                        id_indicadores  varchar(5) NOT NULL,
                        ano  varchar(10) DEFAULT NULL,
                        consumo  varchar(8) DEFAULT NULL,
                        regiao  varchar(28) DEFAULT NULL
);
























































